const useStyles = makeStyles({
  list: {
    width: 250,
  },
  fullList: {
    width: 'auto',
  },
});

class Menu2 extends Component{
    constructor(props){
        super(props);
        this.state = {
            side : '',
            left : false,
        }
    }

    toggleDrawer = (side , open) => event => {
        if (event && event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
            return;
        }
        this.setState({
            side: 'open',
        })
    }    

